import './Main.css';
import logocollage from './Components';
function Main(){
    return (
        <div className='main'>
            <div className='options'>
                <div>
                <img src={logocollage} alt="Collage Photos" />;
                <a href="http://google.com">Collage</a>
                </div>
                <a href="http://google.com">Staged scrolling</a>
                <a href="http://google.com">Carousel</a>
            </div>
        </div>
    );
}
export default Main;
